    <div className="background-color-grey">
      <Form className="container form" onSubmit={ sendEmail }>
        <h2 className="form__text text-center mb-5 pt-4">Formulário de Contato</h2>
        <>
          <FloatingLabel
            controlId="floatingInput"
            label="Nome completo"
            className="mb-3"
          >
            <Form.Control
              type="text"
              placeholder="Nome completo"
              value={ form.name }
              name="name"
              onChange={ handleChange }
              required
            />
          </FloatingLabel>
          <FloatingLabel
            controlId="floatingInput"
            label="E-mail"
            className="mb-3"
          >
            <Form.Control
              type="email"
              placeholder="name@example.com"
              value={ form.email }
              name="email"
              onChange={ handleChange }
              required
            />
          </FloatingLabel>
          <FloatingLabel
            controlId="floatingTextarea2"
            label="Deixe sua mensagem aqui"
            className="mb-3"
          >
            <Form.Control
              as="textarea"
              placeholder="Deixe sua mensagem aqui"
              style={ { height: '100px' } }
              value={ form.message }
              name="message"
              onChange={ handleChange }
              required
            />
          </FloatingLabel>
        </>
        <Button
          variant="primary"
          type="submit"
          className="btn"
          value="Send"
          disabled={ verifyBtn() }
        >
          Enviar
        </Button>
      </Form>
    </div>
  );
}
